var earth_ephemerides_geometry = function(scale) {
    var points = [];
    var indices = [];
    var loc;
    var len = earth_ephemerides_jpl_2010.length;
    if (!(typeof(scale) === "number")) {
        scale = 1;
    }
    for (var i = 0; i < len; i++) {
        loc = earth_ephemerides_jpl_2010[i];
        points.push(loc.x * scale, loc.y * scale, loc.z * scale);
        indices.push(i);
    }
    return { positions: points, indices: indices };
}

